    def msLongwordSwap128(n, **kwArgs):
        # Converts from this:
        # 31 ... 0 63 ... 32 64 ... 95 96 ... 127
        # to this:
        # 127 ... 0
        i1to4 = (n &  0xFFFFFFFF) << 96
        i2to3 = (n & (0xFFFFFFFF << 32)) << 32
        i3to2 = (n & (0xFFFFFFFF << 64)) >> 32
        i4to1 = (n & (0xFFFFFFFF << 96)) >> 96
        
